export const Card = () => {
    console.log(this.props)
    return (
        <div className="card col m-2 p-2">
            <img src="https://aramajapan.com/wp-content/uploads/2014/10/aramajapan_cowboy-bebop.jpg" />
            <div className="card-head">Title fo Painting</div>
            <div className="card-body">
                <h4 className="card-title">Artist Name</h4>
            </div>
        </div>
    )
}
